function HelperCreateImage(array, cont) {
	for (let index = 0; index < array.length; index++) {
		const element 					= array[index];
		link 										= document.createElement('a');
		link.href								= '#';
		link.className					= 'link_stickers';

		btn_stick = document.createElement('button');
		btn_stick.className = 'btn_stick';

		img_stickers 						= document.createElement('img');
		img_stickers.src				= element;
		img_stickers.className	= 'img_stickers';
		
		// img_stickers.setAttribute("name", element);
		btn_stick.appendChild(img_stickers);
		// cont[0].appendChild(link);
		cont[0].appendChild(btn_stick);
	}
}

function CreateImage() {
	
	switch (active_div.id) {
		case 'dhw_13':
			switch (active_element.id) {	
				case 'normal':
					HelperCreateImage(dhw_13_normal, cont);
					break;

				case 'foil':
					console.log(dhw_13_foil);
					HelperCreateImage(dhw_13_foil, cont);
					break;
			}		
			break;

		case 'katowice_14':
			switch (active_element.id) {
				case 'normal':
					HelperCreateImage(katowice_14_normal, cont);
					break;

				case 'holo':
					HelperCreateImage(katowice_14_holo, cont);
					break;

				case 'foil':
					HelperCreateImage(katowice_14_foil, cont);
					break;
			}
			break;

		case 'dh_14':
			switch (active_element.id) {
				case 'normal':
					HelperCreateImage(dh_14, cont);
				
				case 'holo':
					HelperCreateImage(dh_14_holo, cont);
					break;

				case 'foil':
					HelperCreateImage(dh_14_foil, cont);
					break;

				case 'gold':
					HelperCreateImage(dh_14_gold, cont);
					break;
			}

		case 'paris_23':
			switch (active_element.id) {
			case 'normal':
				HelperCreateImage(paris_23_normal, cont);
				break;

			case 'holo':
				HelperCreateImage(paris_23_holo, cont);
				break;

			case 'glitter':
				HelperCreateImage(paris_23_glitter, cont);
				break;

			case 'gold':
				HelperCreateImage(paris_23_gold, cont);
				break;
			}
	}
	img = document.createElement('img');
}

